import React from 'react';
import Main from './src/Components/main';
import { NativeRouter } from "react-router-native"
import { StatusBar } from 'expo-status-bar';

export default function App() {
  return (
    <>
      <StatusBar style="light"/>
      <NativeRouter>
        <Main />
      </NativeRouter>
    </>
  );
}
